  "tasks": {
    "@database.build/deploy#build": {
      "dependsOn": ["^build"],
      "env": [],
      "outputs": ["dist/**"],
      "cache": true
    },
    "@database.build/deploy-worker#dev": {
      "dependsOn": ["^build"],
      "persistent": true,
      "interruptible": true,
      "cache": false
    },
