      "dependsOn": ["^build"],
      "persistent": true,
      "interruptible": true,
      "cache": false
    },
    "@database.build/web#dev": {
      "dependsOn": ["^build"],
      "outputs": [".next/**", "!.next/cache/**"],
      "persistent": true,
      "cache": true
    },
    "@database.build/web#build": {
      "dependsOn": ["^build"],
      "env": [
